(function() {
    "use strict";
    
    var module = angular.module("networkRisk");

    module.component("crqPage", {
        templateUrl: "/app/components/crq/crq.component.html",
        controllerAs: "vm",
        controller: ["$scope", "pageZero", controller],
        bindings: {
            "$router": "<"
        }
    });
    
    function controller($scope, pageZero) {
        var vm = this;
        var bookmark;

        $scope.selected = [];
        
        $scope.filter = {
            options: {
              debounce: 500
            }
        };

        $scope.query = {
            filter: '',
            limit: '25',
            order: 'nameToLower',
            page: 1,
            count: 100, //TEMPORARY: change to what the total count of entries that the query returns is
            listings_per_page_options: [10, 25, 50, 100]
        };

        pageZero.crqData().then(function(response){
            console.log(typeof response == "Object");
            $scope.allData = response.data;
            $scope.desserts = $scope.allData.slice(0, $scope.query.limit);
        });

        $scope.crqSelected = function(data) {
            console.log("row selected: " + JSON.stringify(data));
        };
        
        
        $scope.removeFilter = function () {
            $scope.filter.show = false;
            $scope.query.filter = '';
            
            if($scope.filter.form.$dirty) {
                $scope.filter.form.$setPristine();
            }
        };
        
        $scope.getPageOfData = function(page, limit) {
            console.log("page: " + page);
            console.log("limit: " + limit);
            $scope.desserts = $scope.allData.slice((page - 1) * limit, page * limit);
        };

        $scope.$watch('query.filter', function (newValue, oldValue) {

            console.log("$scope.query.filter: " + $scope.query.filter);
            if(!oldValue) {
              bookmark = $scope.query.page;
            }
            
            if(newValue !== oldValue) {
              $scope.query.page = 1;
            }
            
            if(!newValue) {
              $scope.query.page = bookmark;
            } //$scope.getDesserts();
        });

        /*
        function sticky_relocate() {
            var window_top = $(window).scrollTop();
            var div_top = $('#sticky-anchor').offset().top;
            //console.log(window_top);

            if (window_top > div_top) {
                $('#sticky').addClass('stick');
                $('#sticky-anchor').height($('#sticky').outerHeight());
            } else {
                $('#sticky').removeClass('stick');
                $('#sticky-anchor').height(0);
            }
        }

        $(function() {
            $(window).scroll(sticky_relocate);
            sticky_relocate();
        });
        */
    };

}());













